import React, { useState } from "react";
import Project from "./Project";

const ProjectList = props => {
  const projects = [
    {
      img: "../img/pic01.jpg",
      ref: "",
      title: "Sweet Eats Bakery",
      content:
        "This was the first project at Lambda. I was able to practice sematic HTML and start using CSS."
    },
    {
      img: "../img/pic02.jpg",
      ref: "",
      title: "Great-Idea-Website",
      content:
        "This project was pretty fun to design as we were to match the design files we were given."
    },
    {
      img: "../img/pic03.jpg",
      ref: "",
      title: "First Sprint Challenge!",
      content:
        "This project was pretty fun to design as we were to match the design files we were given."
    }
  ];
  return (
    <section>
      {projects.map(e => (
        <Project project={e} />
      ))}
    </section>
  );
};

export default ProjectList;
